import React from "react";
import TodoListItem from "./todo-list-item";

const TodoList = ({ todos }) => {
  return (
    <ul>
      <li><TodoListItem label={todos[0].label} important={todos[0].important}></TodoListItem></li>
      <li><TodoListItem label={todos[0].label}></TodoListItem></li>
    </ul>
  );
};

export default TodoList;
